import { Container, Card, Row, Col } from 'react-bootstrap';
import './Landing.css';

function Landing() {
  return (
    <Container className="Landing">
      <Row>
        <h1>Meal Planner</h1>
      </Row>
      <Row>
        <Col>Hello</Col> <Card></Card>
      </Row>
      <Row></Row>
    </Container>
  );
}

export default Landing;
